Andy San Dimas, Katie St Ives, Chanel Preston, Chastity Lynn, Lizz Tayler, Stevie Shae

Cumshoe detective Marlowe is on the case to find a wealthy man's missing daughter, deep in the heard of the San Fernando Valley where the underground porn industry lurks just below the twinkling lights and palm trees. Beautiful women and powerful producers try to influence MArlowe who must keep his cool in order to navigate a maze of dangerous suspects. A breakout performance by Tommy Pistol drives this neo-noir thriller through unexpected twists and turns as exciting as they are erotic.
